(25, '100003651503621', 'chị nhung', 'leduchao', '1289', '2', 'haha người bán hàng vừa xinh, hàng lại còn vừa chất lượng chứ <3 !\r\nHàng của bạn rất chuẩn nha nhất là mĩ phẩm ấy dùng tầm 1 tuần là thấy hiệu quả rồi ạ.\r\nChị ơi ib cho em luôn và ngay nha.\r\n<3 <3 <3 \r\nMị nối mi đẹp lắm Mị ạ sẽ giới thiệu thật nhiều khách cho hehe\r\nThả tym thôi ạ :PP \r\nChị còn hàng dạng túi sách với phụ kiện không ib em ngay nha.\r\nHàng xịn người bán hàng cũng xinh ưng sao cho hết\r\nBạn có tuyển cộng tác viên không ạ!\r\nĐây là cô gái nối mi mắt như sao Hàn đây hả mọi người.\r\nCó đặt được lịch tút lại nhan sắc được không ạ mấy lần không tới lượt ạ :((\r\nBung lụa nào :>\r\nChị Nhung ới ib cho em đi ạ\r\nCậu ơi add mình với mình trao đổi chút\r\nDa của mình tự nhiên xuống cấp quá, tư vấn mình với được không?!', '1', '1517119952', '1', '1'),
(26, '100001304581468', 'Cô Tâm', 'leduchao', '1289', '2', 'haha người bán hàng vừa xinh, hàng lại còn vừa chất lượng chứ <3 !\r\nHàng của bạn rất chuẩn nha nhất là mĩ phẩm ấy dùng tầm 1 tuần là thấy hiệu quả rồi ạ.\r\nChị ơi ib cho em luôn và ngay nha.\r\n<3 <3 <3 \r\nThả tym thôi ạ :PP \r\nChị còn hàng dạng túi sách với phụ kiện không ib em ngay nha.\r\nHàng xịn người bán hàng cũng xinh ưng sao cho hết\r\nBạn có tuyển cộng tác viên không ạ!\r\nCó đặt được lịch tút lại nhan sắc được không ạ mấy lần không tới lượt ạ :((\r\nBung lụa nào :>\r\nChị Tâm ới ib cho em đi ạ\r\nCậu ơi add mình với mình trao đổi chút\r\nDa của mình tự nhiên xuống cấp quá, tư vấn mình với được không?!\r\nBuồn vì VN thua nên lên đây kiếm hàng để mua\r\nCủa hàng của bạn ở đâu vậy?', '1', '1517120213', '1', '1'),
(36, '100017483145696', 'ok', 'boyiuboy', '1034', '2', 'Chị ơi em nhận dc hàng rồi, ưng lắm nha!\r\nXài êm lắm nè, em rất thích\r\nCái này thì trắng lắm, xài là bao nghiện luôn!\r\nChị ơi gửi hàng cho em chưa ạ?\r\nChị ơi, gửi qua cho em hộp mới nhé, em hết kem rồi\r\nChị có ở nhà ko em chạy qua lấy hàng nhé\r\nChất kem siêu thấm nè, thích thật!\r\nChị ơi inbox em cách nhập sỉ ạ!\r\nHàng về chưa chị iu, khách dí quá nè!\r\nChị ơi 1 sản phẩm có freeship ko ạ?', '1', '1517404977', '1', '2'),
