(58, '100024539001098', 'Sales Acc 1', '0938787456', '1665', '3', 'Inbox em ạ\r\nGiá sao vậy chị\r\nib\r\nHết ko ạ\r\nCam kết ko ad ơi\r\nGiá ntn?\r\nib ạ\r\n1\r\n2\r\n3\r\n4\r\n5\r\n6\r\nMụn thâm ạ\r\nMụn đầu đen + trứng cá chị ơi\r\nChắc het ko z ad\r\nCo giao hang ko z\r\nBao lau thi het?\r\nLau ko z\r\nThuoc bac hay thuoc ruou z ak\r\nib tư van ak\r\nib tv ad\r\ntư vấn em trọn gói a\r\nco uu tien sv ko z\r\n150k thoi ak\r\n.\r\ncheck ib ak\r\nan toan ko z\r\nxai bao lau thi het thuoc ak\r\nthuoc nay xài được bao lâu ạ\r\nBao lâu thì hết hẳn?\r\ncó tính ship ko z\r\nsu dung ơ nhà hả em\r\ntư vấn cho mình nha\r\nib mình\r\n1 chai như vầy bao nhiêu ml z?\r\nXài mấy chai thì hết z?\r\nHết xong có quay lại ko ad?\r\nsao rẻ z c ơi\r\nmua nhieu co free ship ko ak\r\nmua 2 chai bot ko chi\r\nem chup hinh gui chi xem da dc ko ak\r\nuy tin ko ad\r\nDa em nặng lắm, cam kết ko ạ\r\nHết tất cả 100% mụn luôn ak?\r\nHết thiet ko z ad ơi\r\ncheck hình da em gửi nha c\r\nthuốc rượu hay sao z ad\r\ncho hỏi giá\r\nbảo đảm ko bn ơi', '1', '1518352244', '1', '1'),
(62, '100004103660520', 'V', '01863101360a', '1427', '2', 'Anh ơi chek ib em\r\nAnh ơi cài viplike tự động giá sao ạ\r\nUp uy tín <3\r\nEm mua người theo giỏi giá sao ạ\r\nLike bên anh mượt\r\nRep ib em với\r\nAnh mở khóa nick facebook bao nhiêu ạ \r\nAnh thuận em mua sub\r\nAnh thuận đẹp trai uy tín', '1', '1518638599', '1', '2'),
