(111, '100006486338488', 'Dương Trúc', 'Nguyentuan', '1096', '1', 'Ub e \r\nTư vấn e nha \r\nGửi e 50 hủ \r\nThêm e 50 hủ la 100 hủ nha chị \r\nLên bill e chua chị \r\nKích trắng xài ok lắm nha chị \r\nChị lấy e combo di.  E xài ghiền r \r\nsỉ sao chị \r\nkem xài trắng lắm nha \r\nlấy e 100 hủ đi . E giao hàng cho khách sỉ nửa \r\nLấy e 50 chai kích trắng đi \r\nLấy e 5 bịt tắm trắng với 5 body nha chị \r\nLấy e 2 ô đỏ bạc v 2 combo No1 nha chị \r\nKem xài tốt lắm nha chị , e rất thích \r\nEm ủng hộ chị nè : 50 hủ kem nha chị .\r\ngửi hàng e chưa \r\ngửi xe e chưa \r\nG nhận được hàng r nha chị \r\nGửi cho e 100 hủ đi. \r\nbill cho chị nè : 100 hủ nha với 50 chai kích trắng \r\nib e v chị ơi\r\nEm lm khách sỉ nha chị \r\nIbox\r\nBảng giá sao ạ\r\nMún gia nhập hệ thốg thì ntn\r\nKem xài ok lắm nha chị . Lấy e thêm 2 hộp nửa nha,  e ib địa chỉ chị rồi \r\nGửi Hàng em chưa chị , khách hối quá trời rồi \r\nE xài 5 ngày là lên tone r nè , thích quá \r\nEm nhận dc hàng rồi nha chị \r\nLấy e 2 combo đi,  e mua cho bạn e nữa\r\nSẽ ủng hộ lạn dai dai\r\nTiếp!\r\nQuan tâm', '1', '1520313776', '1', '0'),
