(114, '100022184612506', 'hằng', 'letuphu', '1605', '1', 'C gửi hàng cho em chưa? \r\nGửi hàng mình chưa?\r\nCheck ib em nha c. \r\nCheck ib mình.  \r\nCheck ib c nha. \r\nTư vấn với. \r\nMuốn giảm 3kg thôi. \r\nMình muốn giảm 7kg.\r\nEm muốn giảm 5kg. \r\nMình muốn giảm bắp tay và đùi. \r\nCheck ib hộ với. \r\nGửi em 1 lt nữa. \r\nGửi 2 tuần nữa nha. \r\nGửi mình thêm 1lt nữa nhe. \r\nIb mình. \r\nIb em với. \r\nIb c nha.', '4', '1520345619', '1', '0'),
