(116, '100013276841271', 'Hiha', 'Nguyentuan', '1096', '2', 'Kích trắng xài êm lắm c, thơm mùi trà xanh, tắm xong trắng hẳn.\r\nTiếp!\r\nQuan tâm\r\nIb nha\r\nCheck IB bao giá sỉ em nha c\r\nMình muốn mua kém tặng bạn gai, tư vấn giúp mình\r\nMún gia nhập team thì ntn v b\r\nMình mua 10 hủ tính giá Sao vậy bạn\r\nIb giá sỉ minh nhập\r\nLấy em 2 body. Xài ok e giới thiệu dùm cho\r\nkích trắng xài thích gì đâu, tâm xong thoa kem cứ như sức Nước hoa, thơm quá mà\r\nLên bill sỉ cho c nha e\r\nCho e 5 body+ 5 kích trắng. Gửi e địa Chỉ cũ nha\r\nDa e da ngâm đen, xài kém gì cũng không trắng nổi, mà xài kem bên c có hơn 1 tuần, mà thấy mởn mởn luôn nè\r\nKem xài thích mà giá lại mềm nữa, kiểu này chắc tốn tiền suốt thôi ahihi\r\nChị ơi,  có ship tỉnh k. Ship e hai hộp kem nha\r\nShip long an ch v b\r\nshop cho mik hu này nhen\r\nKem gì đâu nó mịn, thơm, k bết dính nữa chứ, riếc đi ra đường mà thiếu là không được AK.\r\nKem dưỡng body hay makeup tư vấn cho mình với\r\nPhí ship tỉnh bao nhiêu vậy shop\r\nC ở Tp HCM đặt 1 hộp bao giờ thì có vậy?\r\n1 hộp 150k, được free ship với tặng tẩy da chết Phải k AK?\r\nDa em hơi khô và đen, xài cái này được không ạ. Tư vấn nha c\r\nKem dưỡng có chống nắng luôn k c?\r\nKem mới dùg đã thấy trắng rồi. Thích gê\r\nKích trắng sử dụng Sao? Tư vấn giúp em\r\nCombo 250k thôi ha c, Z gửi cho e đi, lát e ib địa chỉ\r\ne nhận được hàng rồi nha, xài thích, thơm ,kém mịn nữa, nào hết e mua tiếp\r\nEm ib điạ chỉ rồi nha c, Mai nhớ gửi em\r\nChi mới xài hết hử hà, mà trắng quá không tin vào mắt mình luôn. Iu shop quá\r\nDa mình hơi nhạy cảm, mà xài sản phẩm bên mình da nó chịu, chắc ủng hộ lâu dài\r\nIb hi chi iu\r\nSẽ ung hộ chi nha\r\nC ơi gửi kem e chưa,khách dí e quá nè.\r\nC ơi e muốn lấy sỉ.\r\nIb e muốn mua kem\r\nTiếp \r\nQuan tâm\r\nGiao e hai hủ gần siêu thị Aeon mall nha c\r\nC có tuyển sỉ k?  Ib báo giá e nha\r\nEm mún gia nhập hệ thống thì ntn b\r\nEm nhận được kem rồi, mà xài êm nên đưa mami dùng, c gửi e thêm combo khác\r\nMình muốn mua kích trắng, tư vấn giúp mình\r\nSài kem có bết dính, hay lộ vân kem gì k, tu van e vou\r\nKích trắng thơm lắm c, test xong da trắng hẳn\r\nChị ơi e mẹ bỉm, có tham gia buôn bán gì được k c.\r\nNay còn khuyến mãi mua combo,free ship và tặng tẩy da chết không chi\r\nE nhận dược kém rồi nghe, cám ơn chị\r\nE nhận dược kém rồi nghe, cám ơn chị\r\nLấy e 3kem, 3 kích trắng Đi, e mua dùm bạn e luôn\r\nSp sai ok lắm \r\nSphẩm sai tốt lắm\r\nMới dùng đã trắg ra rồi thich gì đâu\r\nBạn e nó thấy e xài, thik quá nên nó giành của e rồi, chị giao lại cho e combo khác nghe. E IB dchi\r\nTẩy da chết thơm và mềm quá, kết hợp với kem body tuyệt cú mèo\r\nRep tin nhắn chờ Đi e, c muốn mua kem\r\nGửi e combo nhớ tặng tẩy da chết nhen cậu\r\nC ơi, lấy e hai hủ soc, xài êm quá e mua dùm bạn\r\nE nhận được hàng rồi nha, dùng thích lắm\r\nMặt e dùng được tuần, bớt mụn rồi nè, nào hết e mua tiếp\r\nCho e 5 hử soc Đi, dc e cho sau nghe\r\nIb e mun mua sỉ\r\nC ơi, xài mấy ngày ai cug khen da e sáng, mịn hơn hết\r\nTrời ơi, e mừng quá, mặt e giờ láng, mịn, trắng Lên rồi\r\nCho e thêm, 2 soc, 5 kem body, 5 kích trắng\r\nLấy e 10 hủ soc, tính gia Sao c\r\n', '1', '1520407508', '1', '0'),
