(118, '100009654829081', 'lien nguyen 20/1 - hieu	', 'giahuy1', '1684', '1', 'Boss ib nhà pp chính sách như thế nào\r\n\r\nboss tổng đai lý vốn nhiêu ạ\r\n\r\nChị  ơi e muốn làm đại lý\r\n\r\nchi  xem tin nhắn chờ e với.\r\n\r\nChị   ơi tuyển chi nhánh ko chị\r\n\r\nboss ơi xem tin nhắn chờ e với.\r\n\r\n\r\n\r\nBoss tu vân serum lenaln e với\r\n\r\nboss ơi e muốn pp cao dạ dày tu vấn e với\r\n\r\nChị ơi hà nội có nhà pp chưa chị\r\n\r\nBoss ơi e ở hcm e muốn làm đại lý\r\n\r\nboss ơi ở quảng bình có nhà pp ko chị\r\n\r\nboss ơi e muôn làm nhà pp serum lenaln', '1', '1520430180', '3', '0'),
(119, '100010631700690', 'k', 'Tiểu Kim Ô', '1073', '2', 'E đã dùng. Hiệu quả\r\nVy&tea số1\r\nE đặt 1 hộp\r\nE đặt 1liệu trình\r\nIb sĩ cho e chị\r\nCtv ko c?\r\nGiá sao vậy c\r\nTrà dể uống ko c?\r\nE uống tăng cân tăng dc 3kí còn Ck e uống giảm cân giảm 4 kí  á c\r\nQuảng bình ship ko c? \r\nCó tốn phí ship ko c? Dùng bao lâu thì hiệu quả\r\nCó tác dụng phụ ko c?\r\nE cần tv\r\nE làm sĩ có dc hổ trợ j ko c?\r\nCó bỏ hàng tiệm thuốc tây ko c??\r\nCháu e 14 tuổi dùng dc ko c?\r\n55 tuổi dùng dc ko?\r\nCó mất ngủ ko?', '1', '1520434010', '1', '0'),
