(121, '100008286583377', 'basachi - 8/3 - hieu - autott,cmt	3tháng 900k ( tặng 1 tháng )', 'giahuy1', '1684', '2', 'Check bill chế ơi\r\nIb e lấy sỉ\r\nGia nay bao nhiu c?\r\nLấy sỉ bao nhiu chai?\r\nE muốn lam đại lý thi sao c?\r\nC nhận được tiền chưa?\r\nChi cho e đia chỉ showroom?\r\nC oi gui hàng e chua?\r\nGood co hàng ko c?\r\nBo test c còn không?\r\nE muốn nhập hàng số lương nhìu c có không?\r\nMui thơm quá c\r\nC tư vấn mùi cho e nhé\r\nE cần tư vấn mùi chế\r\nHàng mình co bao nhiu mui\r\nĐiều kiện như thế nào mới đc lấy sỉ\r\nGiao e mỗi loai 10lố\r\nCháy hàng nữa rồi chế ơi\r\nBơm hàng gấp cho e nhé chế\r\nMai e ghé showroom chi nha\r\nChi cho e xin dia chi showroom o Cao lanh\r\nE nhận hàng rồi \r\nMai e qua chị lấy hàng thêm\r\nHàng vừa về là hết sach rồi\r\nGiao hàng cho e sớm nhé\r\nSoạn hàng cho e chưa', '2', '1520507454', '1', '0'),
