(123, '100006667307804', '#l_10', 'nguyentientai1985', '1380', '2', 'Ib bạn ơi\r\nInbox em anh ơi\r\nĐẹp quá, xin giá tham khảo\r\nib\r\nib\r\nib giá\r\nib\r\nib\r\nib\r\nib giá\r\nib\r\nĐẹp quá\r\nib\r\nib\r\nib giá\r\nib\r\nib\r\nib\r\nib giá\r\nib\r\nĐẹp quá\r\nib\r\nib\r\nib giá\r\nib\r\nib\r\nib\r\nib giá\r\nib\r\nĐẹp quá\r\nib\r\nib\r\nib giá\r\nib\r\nib\r\nib\r\nib giá\r\nib\r\nIb giá thợ ib\r\nib\r\nib giá\r\nib\r\nib\r\nib\r\nib giá\r\nib\r\nĐẹp quá', '1', '1520563189', '1', '0'),
(124, '100005071440369', 'k', 'Tiểu Kim Ô', '1073', '2', 'Hóng\r\nQuan tâm\r\n.\r\nĐịa chỉ shop ở đâu vậy\r\nĐã có thuốc tăng cân chưa chị\r\nĐã có thuốc giảm cân chưa chị\r\nEm ib số điện thoại. Chị tư vấn e nhé\r\nSản phẩm hiệu quả lắm. Gửi chị hộp nữa về địa chỉ cũ nhé\r\nChiều mang hàng xuống nhà chị nhé. Hôm nay chị ở nhà\r\nE tăng được 3kg rồi. Mai gửi e 2 hộp nữa nhé\r\nE giảm được 3kg rồi c ạ. Mừng quá\r\nSản phẩm có an toàn không. E mới sinh c ạ\r\nBé nhà em 2 tháng có dùng được không\r\nSản phẩm hiệu quả lắm c ơi. Gửi thêm e 2 hộp nữa nhé\r\nIb e đặt hàng c ơi\r\nMai gửi thêm e 20 hộp nữa nhé. E cháy hàng rồi.\r\nChị gửi hàng e chưa. E đang hóng quá\r\nChị kiểm tra tin nhắn đi. Em muốn tư vấn\r\n. Chị tuyển ctv không chị. Em muốn làm\r\nCái này bao nhiêu tiền hả chị\r\nChỉ mình cách dùng với bạn\r\nCó sỉ không chị. Ib đi\r\n E vừa nhận được rồi chị nhé. Cảm ơn chị ạ', '1', '1520564275', '1', '0'),
