(134, '100006793660126', 'Ngọc mai', 'Ngthhai1998', '822', '2', 'tốt lắm mình sẽ ủng hộ nữa, hiệu quả tốt thật\r\nRep tớ nhé \r\nHiệu quả không ạ ? vì tớ mới dùng bạn đầu\r\nSản phẩm dùng hiệu quả, sẽ ủng hộ tiếp ạ \r\nCho e hỏi ? khi nào thì hàng em tới ạ, mà nếu đặt số lượng lớn thì có giãm phí SHIP ko nhỉ ???\r\nTư vấn giúp mình với ạ, nếu ok sẽ ủng hộ.\r\nib giá sỉ cho mình nhé.\r\nmình muốn đặt hàng thì làm thế nào hả bạn\r\nMình nhận được hàng rồi, cám ơn bạn nhé \r\nTốt, sẽ ủng hộ chị tiếp ạ \r\nTớ dùng mới nữa tháng mà thấy hiệu quả rõ rệt luôn bạn ơi, cám ơn nhé.\r\nTrả lời tin nhắn và tư vấn giúp nha \r\nHiệu quả rõ rệt luôn chị ơi \r\ncám ơn nhá \r\nTương tác bài viết giúp mình với bạn, mình tt lại nhé \r\nMai gửi hàng cho mình nhé. Bán cái này chạy thích lắm.\r\nBnhiu c ?\r\nRep tin nhắn e nhé !\r\nTốt, sẽ ủng hộ chị tiếp ạ \r\nLike \r\nGiá sĩ lấy sao c oi ?\r\nĐặt nhiều có giãm giá không ạ ?\r\nmình muốn đặt hàng thì làm thế nào hả bạn \r\nib giá sỉ cho mình nhé \r\nsản phẩm tốt lắm mình sẽ ủng hộ nữa  \r\nhiệu quả tốt thật \r\nib nhes ? \r\ninb chị\r\ninbx nhé @@\r\nHang chị gửi e chưa sao lâu thế nhỉ\r\nGởi e ckua\r\n Hóng hàng về\r\n C ơi cho e làm cùng với ạ\r\n Ib báo giá sỉ\r\n Thứ 3 gửi hàng cho e nhé\r\n bn vậy b ?\r\n Có sỉ ko bạn ạ?báo giá sỉ mình nhé. \r\n Check inb e c oi\r\n SP ok lắm \r\n Ib sỉ b \r\n e nhận đc hàng rồi nha chế\r\n M nhận đx hàng rồi nhé b\r\n Cái.này giá sao c\r\n Dung ntn vay b\r\n Ib e với ạ\r\n E nhận được Hàng rồi, cám ơn chị nhiều :phí\r\n dùng ok lắm, em sẽ feedbalck lại giúp chị \r\n Gửi hàng cho t nhé\r\n Nhập sỉ ntn vậy b\r\n có tuyển ctv nũa ko cj\r\n ib tv em voi nak\r\n Chi có cần ctv ko, e làm vs nạ\r\n mình nhận được rồi, cám ơn bạn nhé !\r\n C ơi check inbx e với \r\n Nhận dc roi, thanks nhé \r\n Hiệu quả ko nạ\r\n inb nạ\r\n rep inbx em nhe !\r\n ib cj\r\n Mình muốn mua số lượng lớn, có giãm giá ko ý \r\n ví dụ mình mua nhiều thì có giãm ko nè \r\n sự dụng hiệu quả lắm bạn, cám ơn nhé \r\n Có tuyển ctv ko 