(135, '100011749508342', 'Thà Thắm Thịnh', 'Nguyentuan', '1096', '2', 'Chị h e lấy 3body và 2serum là thành 5sp chị tính sỉ cho e nha\r\nTắm trắng cao cấp còn k chị cho e 5gói nữa về e vừa dùng vừa bán ,tắm thơm quá chị oi\r\nChị mua 2 serum đuoc tặng tắm trắng cao cấp đúng k chị,đúng thì gởi cho e 2 lọ nữa nha\r\nChị mua 3 serum nha\r\nTiếp \r\nQuan tâm\r\nE mua combo serum và bột thảo dựoc thì có được giá tốt k chi\r\nChị gởi cho e 10body nữa nha,gởi xe buyt nha chị,cho nhanh\r\nBưu điện gia hang r nha b\r\nChị nhận đuoc kem với tắm trắng rồi nha e,nói thật hồi h xài tòan hàng e bán k à,yên tâm\r\nGởi cho chị 1serum ,1face tổ yến, 1body ,mua một lần 3 món có tặng gì k ta\r\nThắm ơi,e soạn cho chị 50serum,50body và 20tắm trắng sẵn đi,rồi chiều chị chuyển tiền là e gởi xe chi liền nha\r\nChị thắm chị lấy e một serum 160k còn 40k chị lấy bột cho e ,là chẵn 200k,miễn sip đúng k chi\r\nChị son kiều lên màu đẹp lắm,bữa nào có tiền e nóu chi mang xuống cho e cây cam đất nữa nha\r\nChị kem face tổ yến bao nhiêu hộp là đuoc sỉ chị,để biết e rủ bạn e mua chung cho lợi  hihi\r\nIb minh nha\r\nShop cho minh đặt hộp nay\r\nChị chiều khỏang 4h chị mang xuống cho e hộp body với gói tắm trắng nha chi\r\nE nhận đựoc body rồi nha,sao 50hộp mà chị gởi túi chi nhiều zi,hihi cảm ơn chi nha\r\nChi e mới dùng kem body no1 có một tuần à mà ai cũng nói e trắng hết,e mới giới thiệu cho con bạn e á,chuẩn bi nó mua á\r\nChị lấy e thêm cây son mày cam tuơi nữa nha chi,son chị lên màu đẹp lắm\r\nChị h e lấy hàng của chị về bán ,chị hứong dẫn e với nha\r\nThắm gởi tui 50body nữa nha,để tui chuyển khỏang cho đỡ tốn tiền sip\r\nBưu điện giao hang r nha b\r\nChị oi e kết hợp serum với face tổ yến như chi huớng dẫn h da mặt e đẹp lắm chi oi,e có xong mặt với bột kiều một tuần 1 lần nữa\r\nChi chiều xuống bến xe minh dũng gởi vào sg cho e 50serum nha chị,chứ h gởi buu điện lâu lắm ,khách đang hối\r\nSerum kiều hiệu quả thật đó chi,hôm bữa cu e bị muỗi chít e thoa serum lên 15phut sau thấy hết liền\r\nChị chiều 2h gởi xe lên chi e 100body no1 nha,nhớ nha chi\r\nE nhận đuoc kem rồi nha chi,kem thơm và thấm lắm\r\nShop bán hàng rất chất luợng,tư vấn nhiệt tình vui vẻ ,rất thích\r\nMình nhận đc rồi nha b\r\nGửi hàng minh ch bạn', '1', '1520744672', '1', '0'),
