(150, '371176719948424', 'Sunny Shop', 'megazine', '1728', '3', 'Shop check ib e với ạ. \r\nBao nhiêu vậy shop?.\r\nLinh Linh mua ko.\r\nChat lieu gi vay a.\r\nCai nay free size ha shop, 60kg vua ko a.\r\nShip cho minh bo nay. \r\nSh này bán đồ đẹp nè. \r\nSỉ bn. \r\nRep ib với ạ. \r\nCheck ib shop ơi. \r\n48kg vua ko shop oi. \r\nCai nay xinh qua.\r\nShip q5 nhieu ạ?.\r\nShip q3 nhieu sh.\r\nib em nhé.\r\nrep tn em với.\r\nem đặt cái này nhé.\r\nib.\r\nrep ib nha shop.', '1', '1520944318', '1', '0'),
(151, '100008867865454', 'Thanh Hằng', 'tienkietboi', '488', '1', 'hàng đẹp hơn trong hình nhé\r\nmình ib địa chỉ và số đt nha\r\nchiều nay gửi cho mình cái đó nhé, địa chỉ cũ nha\r\nbáo giá đi bạn\r\nMuốn mua thì như nào bạn ơi\r\nMai em cọc nhé chị, nhớ lấy hàng đẹp nhất cho e đấy nhé, đẹp giống cái trước là ok\r\nbạn ơi mình nhận được rồi nha\r\nbạn chụp hình làm mình mất ngủ, nhận đc hàng vui ghê tks b nhieu nha\r\nhàng chất luong\r\nCho to xin so tk de ck nhe\r\nBán hàng dễ chịu như vậy khách nào mà không mua <3\r\nMai chị đến xem nha\r\nNhiêu tiền vậy em ?\r\nEm ơi check ib đi, c vừa nhắn đó\r\nCó bán sỉ ko chị ?\r\nNhận đc hàng rồi nha gái.\r\nTrùi ui đẹp quá, làm sao mua bây giờ ?', '1', '1521004179', '1', '0'),
