(153, '100018331410539', 'Hồng răng khểnh', 'kieutrang1996', '1634', '1', 'Bạn ơi tư vấn mình bộ này với\r\nBộ này bán sao vậy shop\r\nBạn ơi co ship về VIỆT NAM không bạn\r\nBộ này em dùng rồi ok lắm\r\nIn box Tư vấn cho m nhé\r\nGiá sao bạn ơi\r\nDa em mụn dùng bô nao được chị,tư vấn giúp em\r\nDa mình lỗ chân lông hơi to dùng bô này được ko a\r\nCo kem chống nắng không ban ơi\r\nCo son nào dưỡng môi không ban oi\r\nTư vấn mình bộ nà y nhé\r\nCho mình giá bộ này\r\nM muốn mua 1 bộ tặng bạn gái ib tư vấn mình\r\nDa mắt bạn gái mình co nhờn và chút mụn dùng bô nao thì ok b\r\nDa mặt bạn gái mình hơi nhờn và co mụn tư vấn mình bộ đi bạn', '1', '1521010006', '1', '0'),
