Cho chi bang giá nhug sp ben em nhe de chi kham khao dc chi lam đại lý bên em\r\nTư vấn chị liền nhe em ơi . Chi muon mua kem voi sua og chúa\r\nEm gui xe cho chi 50kem .30 mộc trà x2. 30 sữa ong chúa .\r\nEm len bill 100 kem . 20 kich trắng .30 tt mộc tra x2. 50 sữa ong chúa .tính tiền báo em ck cho chi gui xe cho nhanh\r\nSưa ong chúa đắp mặt xong rữa mặt da mịn mềm như da em bé zay do .\r\nSưa ong chúa đắp mặt xong rữa mặt da mịn mềm như da em bé zay do .\r\nĐắp soc xong mụn cám .mun đầu den em không thấy đâu hết hihi thik qua chi oi\r\nGui chi 20 tt mộc trà x2 nhe em .gui nhanh dum chị\r\nEm ơi chi muốn mua 2 sp bên em ', '1', '1521633886', '1', '0'),
